import benchImage from "../assets/mobile/image-grid-2.jpg";
function BenchWithArt() {
  return (
    <div>
      <div className="BenchWithArt">
        <img
          src={benchImage}
          alt="Empty art room exhibit with a wooden bench in the foreground with a piece of art in the background on the wall"
        ></img>
      </div>
    </div>
  );
}

export default BenchWithArt;
